import React from 'react';
import Sdata from './Sdata';
import Cards from './Card';

const App = ()=>{
    <>  <h1 className="heading_style">LIST OF TOP 5 NETFLIX SERIES IN 2021</h1>
<div className="flexBox">
{Sdata.map((value) =>{
    return (
        <Cards key={value.id}
        imgsrc={value.imgsrc}
        title={value.title}
        sname={value.sname}
        Sname={value.link}
      />
    )

})}

    
</div>
</>
}

export default App;
